import "./App.css";
import Airport from "./Airport";
import Travelling from "./Travelling";
import { Switch, Route, Redirect, useHistory } from "react-router-dom";

function App() {
  return (
    <>
      <Switch>
        <Route exact path="/">
          <Airport />
        </Route>
        <Route exact path="/travelling">
          <Travelling />
        </Route>
        <Route exact path="/*">
          <Redirect
            to={{
              pathname: "/home",
            }}
          />
        </Route>
      </Switch>
    </>
  );
}

export default App;
